import React, { useState } from "react";

export default function ExportImportComponent() {
  return (
    <div class="imp_exp">
      <div class="button_group">
        <button className="create_matrix_btn" id="btn">
          Экспортировать
        </button>
        <button className="create_matrix_btn" id="btn">
          Создать матрицу весов
        </button>
      </div>
    </div>
  );
}
